import React, {useState} from "react";
import API from "../utils/API/apiRoutes";
import Card from "react-bootstrap/Card";


function Home() {
    const [rate, setRate] =useState()

    function getRate(){
        API.getRate()
        .then(res => {
            console.log(res.data)
            setRate(res.data)
        })
    }

    return (
        <>
            <button onClick={getRate}>Click here for rate</button>
            <br></br>
            <p>Rate: {rate}</p>
        </>
    )
}

export default Home
